// src/components/AtendimentosList.js
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import styles from './AtendimentosList.module.css';

const AtendimentoList = () => {
    const [atendimentos, setAtendimentos] = useState([]);
    const clienteId = 1; // ID do cliente, pode vir do contexto ou props
  
    useEffect(() => {
      // Buscar atendimentos do cliente
      axios.get(`/atendimento?clienteId=${clienteId}`)
        .then(response => {
          setAtendimentos(response.data);
        })
        .catch(error => {
          console.error("Erro ao buscar atendimentos:", error);
        });
    }, [clienteId]);
  
    return (
      <div className={styles.main}>
        
            <p>Meus</p>
            <p>Atendimentos</p>
       
        <ul>
          {atendimentos.map(atendimento => (
            <li key={atendimento.id}>
              {/* Exiba informações do atendimento aqui */}
              {atendimento.barbeiroNome} - {atendimento.horario}
            </li>
          ))}
        </ul>
        <Link to="/criar-atendimento">
          <button>Criar Novo Atendimento</button>
        </Link>
      </div>
    );
  };
  
  export default AtendimentoList;
